import { NavLink } from 'react-router-dom';

function Navigation() {
  return (
    <nav>
      <NavLink to="/" exact className="myappac" activeClassName="active">
        Home
      </NavLink>
      <NavLink to="/my-appac" className="myappac" activeClassName="active">
        Go to Myappac
      </NavLink>
    </nav>
  );
}
